class Solution(object):
    def maxPartitionsAfterOperations(self, s, k):
        def max_partitions(s, k):
            n = len(s)
            if n == 0: return 0
            prefix = [0] * (n + 1)
            for i in range(n):
                prefix[i + 1] = prefix[i] | (1 << (ord(s[i]) - ord('a')))
            result = 0
            for i in range(n):
                changed = prefix[i + 1]
                for c in range(26):
                    current = changed | (1 << c)
                    count = bin(current).count('1')
                    if count <= k:
                        j = i + 1
                        while j < n and bin(prefix[j + 1] & current).count('1') <= k:
                            j += 1
                        result = max(result, 1 + max_partitions(s[j:], k))
            if bin(prefix[n]).count('1') <= k: result = max(result, 1)
            return result

        return max_partitions(s, k)

